import React from 'react';
import { Link } from 'react-router-dom';
import './sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <Link to="/dashboard">
        <div className="sidebar-item">Dashboard</div>
      </Link>
      <Link to="/api-keys">
        <div className="sidebar-item">API Keys</div>
      </Link>
      <Link to="/sdks">
        <div className="sidebar-item">SDKs</div>
      </Link>
      <Link to="/deployments">
        <div className="sidebar-item">Deployments</div>
      </Link>
      <Link to="/wizard">
        <div className="sidebar-item">Wizard</div>
      </Link>
    </div>
  );
};

export default Sidebar;
